const MainTabItems = [
  {
    className : "nav-link active",
    url : "<Flight/>",
    title : "Flights",
    toggle : "tab"
  },
  {
    className : "nav-link",
    url : "<Hotel />",
    title : "Hotels",
    toggle : "tab"
  },
  {
    className : "nav-link",
    url : "</car>",
    title : "Car Rentals",
    toggle : "tab"
  }
]

export default MainTabItems;
